    "name": "Sid Meier's Civilization V",
    "steam_appid": 8930,
    "detailed_description": "The Flagship Turn-Based Strategy Game Returns\r<br>\r<br>Become Ruler of the World by establishing and leading a civilization from the dawn of man into the space age: Wage war, conduct diplomacy, discover new technologies, go head-to-head with some of historys greatest leaders and build the most powerful empire the world has ever known.\r<br>\r<br><ul class=\"bb_ul\"><li><strong>INVITING PRESENTATION:</strong> Jump right in and play at your own pace with an intuitive interface that eases new players into the game. Civ veterans will appreciate the depth, detail and control that are highlights of the series.\r<br></li><li><strong>BELIEVABLE WORLD:</strong> Ultra realistic graphics showcase lush landscapes for you to explore, battle over and claim as your own. Art deco influences abound in the menus and icons in the most well-designed Civ ever developed.\r<br></li><li><strong>COMMUNITY &amp; MULTIPLAYER:</strong> Compete with Civ players all over the world or locally in LAN matches, mod* the game in unprecedented ways, and install mods directly from an in-game community hub without ever leaving the game. Civilization V brings community to the forefront.\r<br></li><li><strong>WIDE SYSTEM COMPATIBILITY:</strong> Civilization V operates on many different systems, from high end DX11 desktops to many laptops. Enjoy unlimited installations on multiple PCs with your Steam account and take your Civ V experience with you everywhere you go.\r<br></li><li><strong>ALL NEW FEATURES:</strong> A new hex-based gameplay grid opens up exciting new combat and build strategies. City States become a new resource in your diplomatic battleground. An improved diplomacy system allows you to negotiate with fully interactive leaders. Custom music scores and orchestral recordings give Civ V the level of polish and quality you expect from the series.\r<br></li><li><strong>SOCIALLY RESPONSIBLE:</strong> 2K Games is donating a total of $250,000 to four education based charities, and users' choices will determine how the money is dispersed: simply select your choice from the pre-selected charities during the install process.\r</li></ul>*Modding SDK available post launch as a free download.\r<br>\r<br> Charity selection available until Dec. 31, 2010. Not valid in all territories.\r<br>    \r<br><strong>Note:</strong> The Mac and Linux + SteamOS versions of Sid Meier's Civilization V are available in English, French, Italian, German and Spanish only.",
    "about_the_game": "The Flagship Turn-Based Strategy Game Returns\r<br>\r<br>Become Ruler of the World by establishing and leading a civilization from the dawn of man into the space age: Wage war, conduct diplomacy, discover new technologies, go head-to-head with some of historys greatest leaders and build the most powerful empire the world has ever known.\r<br>\r<br><ul class=\"bb_ul\"><li><strong>INVITING PRESENTATION:</strong> Jump right in and play at your own pace with an intuitive interface that eases new players into the game. Civ veterans will appreciate the depth, detail and control that are highlights of the series.\r<br></li><li><strong>BELIEVABLE WORLD:</strong> Ultra realistic graphics showcase lush landscapes for you to explore, battle over and claim as your own. Art deco influences abound in the menus and icons in the most well-designed Civ ever developed.\r<br></li><li><strong>COMMUNITY &amp; MULTIPLAYER:</strong> Compete with Civ players all over the world or locally in LAN matches, mod* the game in unprecedented ways, and install mods directly from an in-game community hub without ever leaving the game. Civilization V brings community to the forefront.\r<br></li><li><strong>WIDE SYSTEM COMPATIBILITY:</strong> Civilization V operates on many different systems, from high end DX11 desktops to many laptops. Enjoy unlimited installations on multiple PCs with your Steam account and take your Civ V experience with you everywhere you go.\r<br></li><li><strong>ALL NEW FEATURES:</strong> A new hex-based gameplay grid opens up exciting new combat and build strategies. City States become a new resource in your diplomatic battleground. An improved diplomacy system allows you to negotiate with fully interactive leaders. Custom music scores and orchestral recordings give Civ V the level of polish and quality you expect from the series.\r<br></li><li><strong>SOCIALLY RESPONSIBLE:</strong> 2K Games is donating a total of $250,000 to four education based charities, and users' choices will determine how the money is dispersed: simply select your choice from the pre-selected charities during the install process.\r</li></ul>*Modding SDK available post launch as a free download.\r<br>\r<br> Charity selection available until Dec. 31, 2010. Not valid in all territories.\r<br>    \r<br><strong>Note:</strong> The Mac and Linux + SteamOS versions of Sid Meier's Civilization V are available in English, French, Italian, German and Spanish only.",
